import './App.css';

class Character {
  #class_;
  #spec;
  #race;

  constructor(class_, spec, race) {
    this.class_ = class_;
    this.spec = spec;
    this.race = race;
  }
}

const Person = (props) => {
  return (
    <>
      <h1>Class: {props.class}</h1>
      <h2>Spec: {props.spec}</h2>
      <h3>Race: {props.race}</h3>
    </>
  )
}

const App = () => {
  const saddled = new Character("Demon Hunter", "Vengence", "Blood Elf");
  const preastmode = new Character("Priest", "Holy", "Undead");

  return (
    <div className="App">
      <h1>
        <Person class={preastmode.class_} spec={preastmode.spec} race={preastmode.race}/>
        <Person class={saddled.class_} spec={saddled.spec} race={saddled.race}/>
      </h1>
    </div>
  );
}

export default App;
